import React from 'react';

class DisplayInfor extends React.Component {
    render() {
        list=this.props.user
        return (
            <div>
                 { this.list.map((user)=> {
                    return (
                        <div>
                        {/* <h1>Tôi tên là {user.name} và tôi {user.age} tuổi</h1> */}
                        <hr/>
                        </div>
                        
                    );
                 })

                 }
            </div>
        );
    }
}

export default DisplayInfor;
